import { combineReducers } from "redux";

import { currentlyPlaying } from "./currentlyPlaying";
import { playingStatus } from "./playingStatus";
import { playlist } from "./playlistReducers";

export default combineReducers({
  currentlyPlaying,
  playingStatus,
  playlist
});
